import React from 'react';
import SimplexForm from './SimplexForm';
import { CssBaseline, Container } from '@mui/material';

function App() {
  return (
    <div className="App">
      <CssBaseline />
      <Container maxWidth="md">
        <SimplexForm />
      </Container>
    </div>
  );
}

export default App;
